import './App.css';
import Header from './components/header';
import SideBar from './components/sideBar';

function App() {
  return (
  <div className='Wrapper'>
    <Header />
    <SideBar />
    <nav className="mainContent">
      <div>
        <img src="https://www.industrialempathy.com/img/remote/ZiClJf-1920w.jpg" alt="content-img" className="mainContent__content-img" />
        </div>
        <div className="mainContent__profile">
        <img src="https://i.pinimg.com/236x/85/06/5d/85065dd0aba6a51eb023f029f879b62a.jpg" alt="avatar" className="mainContent__profile__avatar" />
          <ul className='mainContent__profile__info'>
            <li>name:Nazar</li>
            <li>age:15</li>
            <li>birthday: 4 August</li>
          </ul>
        </div>
        <div className="mainContent__posts">
          <div className="mainContent__posts__title">MyPosts</div>
          <textarea className='mainContent__posts__text-area' name="post" id="1" cols="30" rows="10"></textarea>
        </div>
    </nav>
  </div>
  );
}




export default App;
